	const items = [
		{
			type:'navItem',
			icon:'home',
			text:'Home',
			link:'/',
			restricted:false
		},
		{
			type:'navItem',
			icon:'file-text-o',
			text:'My Profile',
			link:'/user',
			restricted:false
		},
		{
			type:'navItem',
			icon:'file-text-o',
			text:'Add Admins',
			link:'/user/register',
			restricted:false
		},
		{
			type:'navItem',
			icon:'fa-sign-in',
			text:'Login',
			link:'/login',
			restricted:false
		},
		{
			type:'navItem',
			icon:'file-text-o',
			text:'My Reviews',
			link:'/user/user-reviews',
			restricted:false
		},
		{
			type:'navItem',
			icon:'file-text-o',
			text:'Add Reviews',
			link:'/user/add',
			restricted:false
		},
		{
			type:'navItem',
			icon:'fa-sign-out',
			text:'Logout',
			link:'/user/logout',
			restricted:false
		}
	]

	const element = (item,i) => (
		<div>
			icon
		</div>
	)

	const showItems = () => {
		items.map((item,i)=>{
			return element(item,i)
		})
	}

	return (
		<div>
		hey bro
			{showItems()}
		</div>
	)
}

export default SidenavItems;
